pragma solidity ^0.4.11;

// import "./SuccAccessControl.sol";

/// @title Base contract for CryptoSuccs. Holds all common structs, events and base variables.
/// @author Axiom Zen (https://www.axiomzen.co)
/// @dev See the SuccCore contract documentation to understand how the various contract facets are arranged.
contract SuccBase {
    /*** EVENTS ***/

    /// @dev The Sprout event is fired whenever a new pup comes into existence. This obviously
    ///  includes any time a succulent is created through the giveSprout method, but it is also called
    ///  when a new gen0 succulent is created.
    event Sprout(
        address owner,
        uint256 succId,
        uint256 matronId,
        uint256 sireId,
        uint256 genes
    );

    /// @dev Transfer event as defined in current draft of ERC721. Emitted every time a pup
    ///  ownership is assigned, including sprouts.
    event Transfer(address from, address to, uint256 tokenId);

    /*** DATA TYPES ***/

    /// @dev The main Succ struct. Every succulent in CryptoSuccs is represented by a copy
    ///  of this structure, so great care was taken to ensure that it fits neatly into
    ///  exactly two 256-bit words. Note that the order of the members in this structure
    ///  is important because of the byte-packing rules used by Ethereum.
    ///  Ref: http://solidity.readthedocs.io/en/develop/miscellaneous.html
    struct Succ {
        // The Succ's genetic code is packed into these 256-bits, the format is
        // sooper-sekret! A succulent's genes never change.
        uint256 genes;
        // The timestamp from the block when this succulent came into existence.
        uint64 sproutTime;
        // // The minimum timestamp after which this succulent can engage in breeding
        // // activities again. This same timestamp is used for the pregnancy
        // // timer (for matrons) as well as the siring cooldown.
        // uint64 cooldownEndBlock;

        // The ID of the parents of this succ, set to 0 for gen0 succulents.
        // Note that using 32-bit unsigned integers limits us to a "mere"
        // 4 billion succulents. This number might seem small until you realize
        // that Ethereum currently has a limit of about 500 million
        // transactions per year! So, this definitely won't be a problem
        // for several years (even as Ethereum learns to scale).
        uint32 matronId;
        uint32 sireId;
        // // Set to the ID of the sire succulent for matrons that are pregnant,
        // // zero otherwise. A non-zero value here is how we know a succulent
        // // is pregnant. Used to retrieve the genetic material for the new
        // // pup when the sprout transpires.
        // uint32 siringWithId;

        // // Set to the index in the cooldown array (see below) that represents
        // // the current cooldown duration for this Succ. This starts at zero
        // // for gen0 succulents, and is initialized to floor(generation/2) for others.
        // // Incremented by one for each successful breeding action, regardless
        // // of whether this succulent is acting as matron or sire.
        // uint16 cooldownIndex;
        // The "generation number" of this succulent. succulents minted by the CK contract
        // for sale are called "gen0" and have a generation number of 0. The
        // generation number of all other succulents is the larger of the two generation
        // numbers of their parents, plus one.
        // (i.e. max(matron.generation, sire.generation) + 1)
        // uint16 generation;

        uint32 potId;
        uint8 timesWatered;
        uint8 watersNeededIndex;
        bool isBlooming;
    }

    /*** CONSTANTS ***/

    // /// @dev A lookup table indisucculenting the cooldown duration after any successful
    // ///  breeding action, called "pregnancy time" for matrons and "siring cooldown"
    // ///  for sires. Designed such that the cooldown roughly doubles each time a succulent
    // ///  is bred, encouraging owners not to just keep breeding the same succulent over
    // ///  and over again. Caps out at one week (a succulent can breed an unbounded number
    // ///  of times, and the maximum cooldown is always seven days).
    // uint32[14] public cooldowns = [
    //     uint32(1 minutes),
    //     uint32(2 minutes),
    //     uint32(5 minutes),
    //     uint32(10 minutes),
    //     uint32(30 minutes),
    //     uint32(1 hours),
    //     uint32(2 hours),
    //     uint32(4 hours),
    //     uint32(8 hours),
    //     uint32(16 hours),
    //     uint32(1 days),
    //     uint32(2 days),
    //     uint32(4 days),
    //     uint32(7 days)
    // ];

    uint8[8] public watersNeeded = [
        uint8(1),
        uint8(2),
        uint8(4),
        uint8(8),
        uint8(15),
        uint8(25),
        uint8(40),
        uint8(60)
    ];

    // An approximation of currently how many seconds are in between blocks.
    uint256 public secondsPerBlock = 2; // https://explorer-mumbai.maticvigil.com/

    /*** STORAGE ***/

    /// @dev An array containing the Succ struct for all Succs in existence. The ID
    ///  of each succulent is actually an index into this array. Note that ID 0 is a negasucculent,
    ///  the unSucc, the mythical beast that is the parent of all gen0 succulents. A bizarre
    ///  creature that is both matron and sire... to itself! Has an invalid genetic code.
    ///  In other words, succulent ID 0 is invalid... ;-)
    Succ[] succs;

    /// @dev A mapping from succulent IDs to the address that owns them. All succulents have
    ///  some valid owner address, even gen0 succulents are created with a non-zero owner.
    mapping(uint256 => address) public succIndexToOwner;

    /// @dev A mapping from owner address to count of tokens that address owns.
    ///  Used internally inside balanceOf() to resolve ownership count.
    mapping(address => uint256) ownershipTokenCount;

    /// @dev A mapping from SuccIDs to an address that has been approved to call
    ///  transferFrom(). Each Succ can only have one approved address for transfer
    ///  at any time. A zero value means no approval is outstanding.
    mapping(uint256 => address) public succIndexToApproved;

    // /// @dev A mapping from SuccIDs to an address that has been approved to use
    // ///  this Succ for siring via breedWith(). Each Succ can only have one approved
    // ///  address for siring at any time. A zero value means no approval is outstanding.
    // mapping(uint256 => address) public sireAllowedToAddress;

    // /// @dev The address of the ClockAuction contract that handles sales of Succs. This
    // ///  same contract handles both peer-to-peer sales as well as the gen0 sales which are
    // ///  initiated every 15 minutes.
    // SaleClockAuction public saleAuction;

    // /// @dev The address of a custom ClockAuction subclassed contract that handles siring
    // ///  auctions. Needs to be separate from saleAuction because the actions taken on success
    // ///  after a sales and siring auction are quite different.
    // SiringClockAuction public siringAuction;

    mapping(address => uint256) ownerToWaterOrbs;

    /// @dev Assigns ownership of a specific Succ to an address.
    function _transfer(
        address _from,
        address _to,
        uint256 _tokenId
    ) internal {
        // Since the number of pups is capped to 2^32 we can't overflow this
        ownershipTokenCount[_to]++;
        // transfer ownership
        succIndexToOwner[_tokenId] = _to;
        // When creating new pups _from is 0x0, but we can't account that address.
        if (_from != address(0)) {
            ownershipTokenCount[_from]--;
            // // once the pup is transferred also clear sire allowances
            // delete sireAllowedToAddress[_tokenId];
            // // clear any previously approved ownership exchange
            // delete succIndexToApproved[_tokenId];
        }
        // Emit the transfer event.
        emit Transfer(_from, _to, _tokenId);
    }

    /// @dev An internal method that creates a new succ and stores it. This
    ///  method doesn't do any checking and should only be called when the
    ///  input data is known to be valid. Will generate both a Sprout event
    ///  and a Transfer event.
    /// @param _matronId The succ ID of the matron of this succulent (zero for gen0)
    /// @param _sireId The succ ID of the sire of this succulent (zero for gen0)
    // / @param _generation The generation number of this succulent, must be computed by caller.
    /// @param _genes The succ's genetic code.
    /// @param _owner The inital owner of this succulent, must be non-zero (except for the unSucc, ID 0)
    function _createSucc(
        uint256 _matronId,
        uint256 _sireId,
        // uint256 _generation,
        uint256 _genes,
        address _owner
    ) internal returns (uint256) {
        // These requires are not strictly necessary, our calling code should make
        // sure that these conditions are never broken. However! _createSucc() is already
        // an expensive call (for storage), and it doesn't hurt to be especially careful
        // to ensure our data structures are always valid.
        require(_matronId == uint256(uint32(_matronId)));
        require(_sireId == uint256(uint32(_sireId)));
        // require(_generation == uint256(uint16(_generation)));

        // New succ starts with the same cooldown as parent gen/2
        uint8 watersNeededIndex = uint8(succs[_matronId].watersNeededIndex / 2);
        // if (cooldownIndex > 8) {
        //     cooldownIndex = 8;
        // }

        Succ memory _succ =
            Succ({
                genes: _genes,
                sproutTime: uint64(now), // cooldownEndBlock: 0,
                matronId: uint32(_matronId),
                sireId: uint32(_sireId), // siringWithId: 0, // cooldownIndex: cooldownIndex, // generation: uint16(_generation)
                potId: 0,
                timesWatered: 0,
                watersNeededIndex: watersNeededIndex,
                isBlooming: false
            });
        uint256 newPupId = succs.push(_succ) - 1;

        // It's probably never going to happen, 4 billion succulents is A LOT, but
        // let's just be 100% sure we never let this happen.
        require(newPupId == uint256(uint32(newPupId)));

        // emit the sprout event
        emit Sprout(
            _owner,
            newPupId,
            uint256(_succ.matronId),
            uint256(_succ.sireId),
            _succ.genes
        );

        // This will assign ownership, and also emit the Transfer event as
        // per ERC721 draft
        _transfer(0, _owner, newPupId);

        return newPupId;
    }

    // // Any C-level can fix how many seconds per blocks are currently observed.
    // function setSecondsPerBlock(uint256 secs) external onlyCLevel {
    //     require(secs < cooldowns[0]);
    //     secondsPerBlock = secs;
    // }
}

